import { renderData } from "../services/RenderData";

export function City() {

    
    let [getCity, setCity] = useState("Desconhecido!")
    
    
    
    useEffect(() => {
        setCity(renderData());
    }, []);
    
    return(
    <div>
        <p>{getCity}</p>
    </div>
    );
}
